const ProfilePage = () => {
    const user = {
        username: 'johndoe123',
        name: 'John Doe',
        email: 'john.doe@gmail.com',
        // password: 'password',
        contact: '123456789',
        country: 'India',
        feedback: ['Great work', 'Keep it up']
    }
    function viewFeedBack(){
        return (
            <div>
                <h2>FeedBacks</h2>
                {user.feedback.length === 0 ?
                    <p>No Feedbacks</p> :
                <ul>
                    {user.feedback.map((feed, index) => <li key={index}>{feed}</li>)}
                </ul>
                }
            </div>
        )
    }
    return(
    <>
        <h2>User Details</h2>
        <form>
            <label>Name: </label>
            <input type="text" value={user.name ? user.name : ''} /><br />
            <label>Username: </label>
            <input type="text" value={user.username} disabled/><br />
            <label>Email: </label>
            <input type="email" value={user.email} disabled/><br />
            <label>Contact: </label>
            <input type="number" value={user.contact? user.contact: ''} /><br />
            <label>Country: </label>
            <input type="text" value={user.country} /><br />
            <button onClick={viewFeedBack}>View FeedBacks</button>
        </form>
    </>
    )
}

export default ProfilePage;
